import React from 'react';

import { Container, MenuIcon ,LogotoTipo,FiPlusIcon,} from './styles';

function MobileHeader() {
  return (
    <Header>
          <Container>
            <button>
              <MenuIcon/>
            </button>

            <LogotoTipo>
              Divulgacar
            </LogotoTipo>

              <button id="vender">
                <FiPlusIcon/>
                 Vender Veiculo
              </button>



          </Container>
      </Header>

  );
}

export default MobileHeader;
